    public List<LogNewPPMEventResponse> getLogNewPPMEvents(TransactionReceipt transactionReceipt) {
        List<Contract.EventValuesWithLog> valueList = extractEventParametersWithLog(LOGNEWPPM_EVENT, transactionReceipt);
        ArrayList<LogNewPPMEventResponse> responses = new ArrayList<LogNewPPMEventResponse>(valueList.size());
        for (Contract.EventValuesWithLog eventValues : valueList) {
            LogNewPPMEventResponse typedResponse = new LogNewPPMEventResponse();
            typedResponse.log = eventValues.getLog();
            typedResponse.sig = (String) eventValues.getNonIndexedValues().get(0).getValue();
            typedResponse.PPM = (String) eventValues.getNonIndexedValues().get(1).getValue();
            responses.add(typedResponse);
        }
        return responses;
    }

